import React from 'react';
import { Tag } from 'primereact/tag';

// import { Container } from './styles';
interface Props {
    data: any
  }
const Tags: React.FC<Props> = (props:Props) => {
  return   <div className="content-section introduction"><div>  <div className="card">{
    props.data.map((tag: any) =>{
        return <Tag value={tag} className="mr-2 mt-2" icon="pi pi-plus"></Tag>
    })
    } </div></div></div>;
}

export default Tags;
